var findSubstring = function (s, words) {
  let wordsArraySize = words.length;
  let wordsSize = words[0].length;
  let substringLength = wordsArraySize * wordsSize;
  let permuations = [];
  let wordsAllPermuations = permutationsFunction(words)
  console.log(JSON.stringify(wordsAllPermuations))
  if (s.length >= substringLength) {
    for (let index = 0; index < s.length-substringLength+1; index++) {
      let sCopy = s;
      let subString = sCopy.substring(index,index+ substringLength);
      permuations.push(subString);
    }
  }
  console.log(JSON.stringify(permuations))
  let result = []
  outerloop: for (let index = 0; index < permuations.length; index++) {
    for (let subindex = 0; subindex < wordsAllPermuations.length; subindex++) {
        if(permuations[index] === wordsAllPermuations[subindex]){
            result.push(index)
            continue outerloop
        }
    }
  }
  console.log(result)
};
let s = ""
  words =  ["dhvf","sind","ffsl","yekr","zwzq","kpeo","cila","tfty","modg","ztjg","ybty","heqg","cpwo","gdcj","lnle","sefg","vimw","bxcb"]

findSubstring(s, words);


function permutationsFunction(words) {
    const result = [];
  
    function permute(arr, current = []) {
        if (arr.length === 0) {
            result.push(current.join(''));
            return;
        }
      
        for (let i = 0; i < arr.length; i++) {
            const rest = [...arr.slice(0, i), ...arr.slice(i + 1)];
            permute(rest, [...current, arr[i]]);
        }
    }
  
    permute(words);
    return result;
}

